import React from 'react'

export default function BreedingData( {species} ) {
  return (
    <div>
        <h2>Breeding Data</h2>
        <h3>Egg Groups</h3>
        {species.egg_groups.map(group => (<p>{group.name}</p>))}
        <h3>Egg Cycles</h3>
        <p>{species.hatch_counter}</p>
    </div>
  )
}
